async function deletePart(e,t){const n=await fetch("/api/part/remove/"+e+"&"+t,{method:"DELETE",headers:{Accept:"application/json"}});if(n.ok){const e=await n.json();document.getElementById(e).remove()}else{const e=await n.json();console.log(e.message)}}async function CheckExist(e,t){let n=document.getElementsByClassName("form__main-input");const o=await fetch("/api/check/title/"+e+"&"+t+"&"+n[0].value,{method:"POST",headers:{Accept:"application/json"}});if(o.ok){const e=await o.json();let t=document.getElementById("titleerror"),n=document.getElementById("button");e?(t.style.display="flex",t.style.justifyContent="center",n.disabled=!0):(t.style.display="none",n.disabled=!1)}else{const e=await o.json();console.log(e.message)}}